@GuajeSalvaje Esto es lo que votan la mentes inmaduras.
Si te duermes sobre la nieve sabes q morirás, aún así hay quien se duerme; no obstante no se considera un suicidio.
Tu voto también puede ser suicida y no por eso serás considerado como tal.

@jdelrio70 @Claudia_Jordan Tal vez los controles no respondieron.
En ese caso,  nada qué hacer. Afortunadamente funcionó el paracaídas. 
Nadie en sano juicio quiere morir estrellado en una población... A no ser que fuera suicida y falló el avión.

tweets.text:
@Claudia_Jordan Tiene que hacer su mayor esfuerzo por evitar que la nave caiga en sectores poblados.
Claramente, no lo hizo.
Decisión de él fue subirse al avión. La gente de la vivienda no tiene por qué pagar las consecuencias.
